import pandas as pd
import json
import matplotlib.pyplot as plt
import numpy as np


def load_menu_data(path):
    """
    load menu data with csv format
    :param path:
    :return:
    """
    csv_data = pd.read_csv(path, error_bad_lines=False)
    return csv_data


def load_recipe_data(path):
    """
    load recipe data with json format
    :param path:
    :return:
    """
    with open(path, encoding='utf-8') as f:
        json_data = json.load(f)
    return json_data


def text_search(source, target):
    """
    Given a source str, search the most matched string in the target set
    :param source: a source string
    :param target: a string iterable set
    :return:
    """
    matched_idx = -1
    matched_text = ""
    matched_percentage = 0
    matched_target = ""
    for i, target_text in enumerate(target):
        temp_matched_percent, temp_matched_text = find_lcsubstr(source, target_text['name'])
        if temp_matched_percent > matched_percentage:
            matched_percentage = temp_matched_percent
            matched_text = temp_matched_text
            matched_idx = i
            matched_target = target_text['name']
    return matched_idx, matched_text, matched_percentage, matched_target


def find_lcsubstr(s1, s2):
    """
    find longest substring between two string
    :param s1:
    :param s2:
    :return:
    """
    m = [[0 for i in range(len(s2) + 1)] for j in range(len(s1) + 1)]  # 生成0矩阵，为方便后续计算，比字符串长度多了一列
    mmax = 0  # 最长匹配的长度
    p = 0  # 最长匹配对应在s1中的最后一位
    for i in range(len(s1)):
        for j in range(len(s2)):
            if s1[i] == s2[j]:
                m[i + 1][j + 1] = m[i][j] + 1
                if m[i + 1][j + 1] > mmax:
                    mmax = m[i + 1][j + 1]
                    p = i + 1
    return mmax, s1[p - mmax:p]


def auto_label(labels, bins):
    """
    Attach a text label above each bar displaying its height
    """
    print(labels)
    for i, v in enumerate(labels):
        plt.text(bins[i] + 0.015,
                 labels[i] + 2,
                 #v / labels[i] + 100,
                 "{:d}".format(int(labels[i])),
                 fontsize=12)


def draw_hist(data):
    """
    draw hist with data
    :param data:
    """
    n, bins, patches = plt.hist(x=data, bins='auto', color='#0504aa',
                                alpha=0.7, rwidth=0.85)
    plt.grid(axis='y', alpha=0.75)
    plt.xticks()
    plt.xlabel('Value')
    plt.ylabel('Frequency')
    plt.title('Histogram')
    plt.text(23, 45, r'$\mu=15, b=3$')
    maxfreq = n.max()
    # 设置y轴的上限
    plt.ylim(ymax=np.ceil(maxfreq / 10) * 10 if maxfreq % 10 else maxfreq + 10)
    auto_label(n, bins)
    plt.savefig('Histogram')
    plt.show()


def main():
    """
    main function
    """
    menu_path = './sources/sample_menu.csv'
    recipe_path = './sources/recipe.json'
    menu_data = load_menu_data(menu_path)
    recipe_data = load_recipe_data(recipe_path)

    record_file = open('match_record.csv', 'w')
    error_file = open('error_menu.txt', 'w')
    matched_result = []

    for menu_idx, menu in menu_data.iterrows():
        try:
            # for some menu are wrong
            matched_idx, matched_text, matched_percentage, matched_target = text_search(menu['name'], recipe_data)
            matched_result.append(matched_percentage / len(menu['name']))
            record_file.write("{}\t{}\t{}\t{:.2%}\n".format(
                menu['name'],
                matched_text,
                matched_target,
                matched_percentage / len(menu['name'])
            ))
            record_file.flush()
        except:
            error_file.write(str(menu_idx) + '\n')
            continue

    # draw hist
    print(matched_result)
    draw_hist(matched_result)


